const OneWayJson = [
  {
    "element" : "input",
    "type" : "text",
    "id" : "leaving",
    "name" : "leaving",
    "placeholder" : "Leaving From"
  },
  {
    "element" : "label",
    "text" : <i className="fas fa-long-arrow-alt-right"></i>,
    "id" : "arrowto"
  },
  {
    "element" : "input",
    "type" : "text",
    "id" : "going",
    "name" : "going",
    "placeholder" : "Going To"
  },
  {
    "element" : "input",
    "type" : "date",
    "id" : "fromdate",
    "name" : "fromdate"
  },
  {
    "element" : "input",
    "type" : "submit",
    "id" : "search",
    "value" : "search"
  }
]
export default OneWayJson
